import './App.css';
import InputDefault from './Components/Input/Index';
import Menu from './Components/Menu/Index';
import Video from './Components/Video/Index';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PgProduto from './Components/PgProduto/PgProduto.js';

function App() {

  const Gallery = () => {
    return <h2>Gallery</h2>;
  };
  return (
    <div className="App">
      <Menu />
      <Video src="./imagens/video-institucional.mp4" />
      <InputDefault />

      <Routes>
        <Route path="/produto" element={<Gallery />} />
      </Routes>

    </div >

  );
}

export default App;
